import { Route, Routes } from "react-router-dom";
import {Commands} from "./components/Commands"
// import {TicketPlayground} from "./components/ticketPlayground"

function App() {


  return (
    <div className="App">
      <h1>Comander</h1>
      <hr />
      <Routes>
        <Route path="/" element={<Commands />} />
        <Route path="about" element={<h1>About</h1>} />
      </Routes>
      <Commands />
      {/* <TicketPlayground /> */}
    </div>
  );
}

export default App;
